//     justifyContent: "space-between",
//     alignItems: "center",
// }

export const AccordionBdy = ({props}) => {
    return (
    <>

        <div>
            <h3>{props.text}<span>+</span></h3>
        </div>
        <p>{props.heading}</p>
    </>
    )
}
